import React, { useEffect, useRef } from "react";

const Input = () => {
  const divRef = useRef();

  useEffect(() => {
    console.log(divRef.current);
    if (divRef.current) divRef.current.style.backgroundColor = "red;";
  });
  return <div></div>;
};

export default Input;
